import React from "react";

const Stories = () => {
  const [state, setState] = React.useState([
    { id: 1, image: "/images/pic1.jpg", name: "Diana Valentina" },
    { id: 2, image: "/images/pic2.jpg", name: "Freiimara Siilva" },
    { id: 3, image: "/images/pic3.jpg", name: "Barbra Moran" },
    { id: 4, image: "/images/pic4.jpg", name: "Daniela Teran" },
  ]);
  return (
    <div className="stories">
      {state.map((story) => (
        <div className="stories__col" key={story.id}>
          <div className="stories__body">
            <img src={story.image} alt="stories" />
            <div className="stories__body-overlay">
              <div className="stories__body-overlay-img">
                <img src={story.image} alt="" />
              </div>
              <div className="stories__body-name">{story.name}</div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Stories;
